    job_description:
      "Note: By applying to this position you will have an opportunity to share your preferred working location from the following: Toronto, ON, Canada; Sunnyvale, CA, USA; Austin, TX, USA; Chicago, IL, USA; Seattle, WA, USA; San Francisco, CA, USA.Minimum qualifications:\n• Bachelor's degree in Computer Science, Mathematics, a related technical field, or equivalent practical experience.\n• 10 years of experience with cloud infrastructure.\n• Experience building and operationalizing machine learning models.\n• Experience in delivering technical presentations while leading discovery and planning sessions that are aligned jointly with the customer with defined scope and success criteria.\n\nPreferred qualifications:\n• Experience designing/architecting large-scale infrastructure farms for specialist AI use cases.\n• Experience training and fine tuning large models (i.e., image, language, segmentation, recommendation, genomics) with accelerators.\n• Experience with running MLPerf benchmarks.\n• Experience with containerization and Kubernetes (K8s) on cloud.\n• Experience with performance profiling tools.\n• Ability to engage with C-level or executive business leaders and influence decisions.\n\nAbout The Job\n\nWhen leading companies choose Google Cloud, it's a huge win for spreading the power of cloud computing globally. Once educational institutions, government agencies, and other businesses sign on to use Google Cloud products, you come in to facilitate making their work more productive, mobile, and collaborative. You listen and deliver what is most helpful for the customer. You assist fellow sales Googlers by problem-solving key technical issues for our customers. You liaise with the product marketing management and engineering teams to stay on top of industry trends and devise enhancements to Google Cloud products.\n\nAs a Customer Developer, you will partner with technical Sales teams as a subject matter expert in Artificial Intelligence and Machine Learning (AI/ML) to differentiate Google Cloud to our customers. You will help prospective and existing customers and partners understand the power of Google Cloud, develop creative cloud solutions and architectures to solve their business test, engage in proofs of concepts, and troubleshoot any technical questions and roadblocks. You will use your expertise and presentation skills to engage with customers to understand their business and technical requirements, and persuasively present practical and useful solutions on Google Cloud. You will partner with internal engineering stakeholders to improve products and build solutions, optimizing for results when in production and identifying innovative ways to multiply your impact and the impact of the team as a whole.\n\nGoogle Cloud accelerates every organization’s ability to digitally transform its business and industry. We deliver enterprise-grade solutions that leverage Google’s cutting-edge technology, and tools that help developers build more sustainably. Customers in more than 200 countries and territories turn to Google Cloud as their trusted partner to enable growth and solve their most critical business problems.\n\nThe US base salary range for this full-time position is $147,000-$218,000 + bonus + equity + benefits. Our salary ranges are determined by role, level, and location. Within the range, individual pay is determined by work location and additional factors, including job-related skills, experience, and relevant education or training. Your recruiter can share more about the specific salary range for your preferred location during the hiring process.\n\nPlease note that the compensation details listed in US role postings reflect the base salary only, and do not include bonus, equity, or benefits. Learn more about benefits at Google .\n\nResponsibilities\n• Be a trusted advisor to our top customers, helping them understand and incorporate AI accelerators into their overall cloud strategy by recommending migration paths, integration strategies, and application architecture that incorporate Google Cloud AI optimized infrastructure.\n• Demonstrate how Google Cloud is differentiated, highlighting the power of accelerators by working with customers on POCs, demonstrating features, optimizing model performance, profiling, and benchmarking.\n• Build repeatable assets to enable other customers and internal teams.\n• Influence Google Cloud strategy at the intersection of infrastructure and AI/ML by advocating for enterprise customer requirements.\n• Travel to customer sites and events as needed.\n\nGoogle is proud to be an equal opportunity workplace and is an affirmative action employer. We are committed to equal employment opportunity regardless of race, color, ancestry, religion, sex, national origin, sexual orientation, age, citizenship, marital status, disability, gender identity or Veteran status. We also consider qualified applicants regardless of criminal histories, consistent with legal requirements. See also Google's EEO Policy and EEO is the Law. If you have a disability or special need that requires accommodation, please let us know by completing our Accommodations for Applicants form .",
