    job_description:
      "About This Role\n\nWe're seeking an exceptional Full Stack Engineer who thrives at the intersection of cutting-edge AI and scalable software engineering. You'll architect and build the world's most sophisticated AI agents while owning the entire technical stack from database to user interface. This isn't just about implementing existing solutions—you'll pioneer new approaches to AI agent architecture and push the boundaries of what's possible.\n\nWhat You'll Build\n\nRevolutionary AI Agent Systems\n• Design and implement autonomous AI agents capable of complex planning, and execution\n• Build sophisticated agent orchestration systems that coordinate multiple AI models and tools\n• Develop novel approaches to agent memory, learning, and adaptation\n• Create intelligent routing and decision-making systems for multi-agent environments\n\nFull Stack Excellence\n• Architect robust backend systems that can handle real-time AI inference at scale\n• Build intuitive, responsive frontends that make complex AI capabilities accessible\n• Design and optimize databases for high-performance AI workloads and vector storage\n• Implement real-time communication systems for agent-human and agent-agent interaction\n\nInnovation & Research\n• Experiment with the latest AI models, frameworks, and techniques (GPT-4+, Claude, custom models)\n• Prototype and validate new AI agent capabilities and interaction patterns\n• Contribute to open-source AI tools and publish technical insights\n• Stay ahead of the rapidly evolving AI landscape and integrate breakthrough technologies\n\nWhat We're Looking For\n\nTechnical Mastery\n• 5+ years of full stack development with modern frameworks (React/Next.js, Node.js, Python, Go, or similar)\n• Deep understanding of AI/ML fundamentals: transformers, embeddings, vector databases, fine-tuning\n• Experience with LLM APIs, prompt engineering, and AI model integration\n• Proficiency with cloud platforms (AWS, GCP, Azure) and containerization (Docker, Kubernetes)\n• Strong database design skills (i.e. PostgreSQL, MongoDB, vector databases, etc.)\n\nAI Agent Expertise\n• Experience building AI agents, chatbots, or autonomous systems\n• Understanding of agent frameworks (LangChain, CrewAI, AutoGPT, or custom implementations)\n• Knowledge of reinforcement learning, multi-agent systems, or planning algorithms\n• Familiarity with tool use, function calling, and external API integration for AI systems\n\nEntrepreneurial Mindset\n• Owner mentality: You take full ownership of problems and drive them to completion\n• Business acumen: You understand how technical decisions impact user experience and business outcomes\n• Resourcefulness: You find creative solutions with limited resources and tight timelines\n• Vision: You can see the bigger picture and build systems that scale with the company's growth\n\nProblem-Solving Excellence\n• Systems thinking: You design elegant solutions that consider the entire system\n• Debugging mastery: You can troubleshoot complex issues across the entire stack\n• Performance optimization: You build systems that are fast, reliable, and cost-effective\n• User-centric approach: You prioritize solutions that deliver real value to end users\n\nIntellectual Curiosity\n• Continuous learning: You actively stay current with the latest AI research and engineering practices\n• Experimentation: You love prototyping new ideas and aren't afraid to fail fast and iterate\n• Cross-functional collaboration: You enjoy working with researchers, designers, and product teams\n• Teaching and sharing: You contribute to team knowledge and help others grow\n\nTechnical Environment\n\nAI & Machine Learning\n• Latest LLMs (GPT-4, Claude Sonnet, Gemini, open-source models)\n• Vector databases and semantic search systems\n• Real-time inference optimization and caching strategies\n• Custom model fine-tuning and deployment pipelines\n\nBackend Technologies\n• Microservices architecture with event-driven design\n• Real-time APIs (WebSockets, Server-Sent Events)\n• Message queues and distributed task processing\n• High-performance data pipelines and ETL systems\n\nFrontend Excellence\n• Modern React/TypeScript applications with sophisticated state management\n• Real-time user interfaces for AI agent monitoring and control\n• Interactive data visualization and analytics dashboards\n• Mobile-responsive design with accessibility focus\n\nInfrastructure & DevOps\n• Container orchestration and auto-scaling systems\n• CI/CD pipelines with automated testing and deployment\n• Monitoring, logging, and observability for AI systems\n• Cost optimization for GPU compute and inference workloads\n\nWhat Success Looks Like\n\n6 Months: You've shipped multiple AI agent features that users love, optimized our inference pipeline for 10x better performance, and become the go-to person for complex technical challenges.\n\n1 Year: You've architected and built a groundbreaking AI agent system that sets new industry standards, mentored junior engineers, and contributed significantly to our technical strategy and product roadmap.\n\n2 Years: You're recognized as a thought leader in AI agent engineering, have launched features that transformed how users interact with AI, and are helping shape the future direction of autonomous AI systems.\n\nWhy You'll Thrive Here\n• Cutting-edge technology: Work with the latest AI models and techniques before they become mainstream\n• Massive impact: Your code will be used by millions of users and push the boundaries of AI capabilities\n• Learning environment: Collaborate with world-class AI researchers and engineers\n• Ownership culture: Take full ownership of features from conception to deployment\n• Innovation freedom: 20% time for personal projects and research that interests you\n\nReady to Build the Future?\n\nIf you're excited about building AI systems that seemed impossible just a few years ago, thrive in fast-paced environments, and want to be at the forefront of the AI revolution, we want to hear from you.\n\nSend us your resume along with:\n• Examples of AI projects you've built (GitHub repos, demos, or case studies)\n• A brief note about the most interesting technical problem you've solved recently\n• Your thoughts on where AI agent technology is heading in the next 2-3 years",
